import React, { Component } from 'react';

class Skills extends Component {

  render() {
    return (
        <div id='skills'>    
            <div id='title'>My Skills</div>
            <div className='container' id='skills-body'>
                <div className="progress-title"><span>Photoshop</span><span>75%</span></div>
                <div className="progress">
                    <div className="progress-bar" role="progressbar" style={{width: "25%"}} aria-valuenow="75" aria-valuemin="0" aria-valuemax="90"></div>
                </div>
            </div>
        </div>
    );
  }
}

export default Skills;
